import React, { useState } from "react";
import { motion } from "framer-motion";
import "../../Styles/All.css";

const All: React.FC = () => {
  const [onHover, setOnHover] = useState<boolean>(false);
  return (
    <div>
      <motion.div>
        <motion.div className="revenue-container">
          <motion.div style={{ display: "flex" }}>
            <p style={{ fontSize: 30, marginTop: 0 }}>Revenue Flow</p>
            <div style={{ marginLeft: "auto" }}>View All &gt;</div>
          </motion.div>
          <motion.div style={{ display: "flex" }}>
            <motion.div>
              <div>2.5k$</div>
              <div>2.0k$</div>
              <div>1.5k$</div>
              <div>1k$</div>
              <div>0.5k$</div>
              <div>0$</div>
            </motion.div>
            <motion.div
              className="tower"
              initial={{
                background: "repeating-linear-gradient(45deg, rgb(149, 67, 255), rgb(149, 67, 255) 2px, rgba(255, 255, 255, 0) 2px, rgba(255, 255, 255, 0) 10px)",
            }}
            whileHover={{ background: "rgb(149, 67, 255)" }}
              transition={{ duration: 1 }}
              style={{
                marginLeft: 20,
                width: 90,
                height: 140,
                borderRadius: 25,
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                animation: "move-lines 2s linear infinite",
              }}
            ></motion.div>
          </motion.div>
        </motion.div>
      </motion.div>
    </div>
  );
};

export default All;
